import React, {Fragment} from "react";

class GithubProfileDetails extends React.Component{
    constructor(props) {
        super(props);

    }

    render() {
        let {followers, following, public_repos, public_gists,
        name, location, email, company,blog, created_at, html_url } =this.props.profile;
        return (
            <Fragment>
                <div className="card">
                    <div className="card-header bg-light">
                        <span className="badge badge-primary">{followers} Followers</span>
                        <span className="badge badge-success">{public_repos}Repos</span>
                        <span className="badge badge-warning">{public_gists}Gists</span>
                        <span className="badge badge-danger">{following}Following</span>
                    </div>
                    <div className="card-body">
                        <ul className="list-group">
                            <li className="list-group-item">
                                User Name :{name}
                            </li>
                            <li className="list-group-item">
                                Location : {location}
                            </li>
                            <li className="list-group-item">
                                Email : {email}
                            </li>
                            <li className="list-group-item">
                                Company : {company}
                            </li>
                            <li className="list-group-item">
                                Blog : {blog}
                            </li>
                            <li className="list-group-item">
                                Member since : {created_at}
                            </li>
                            <li className="list-group-item">
                                Profile URL : {html_url}
                            </li>
                        </ul>
                    </div>
                </div>
            </Fragment>
        );
    }
}
export default GithubProfileDetails;
